    "top_reviews": "{\"negative\":{\"rating\":2,\"review\":\"I picked the brick red color, ordered it, but got sent the blue one. When I called Walmart they told me I couldn’t just return in store, I had to mail it to the third party, reorder, etc. I ended up keeping this ugly rug for the sheer inconvenience that it brought me. It looks off in the room and not at all the color I ordered. Save yourself the headache.\"},\"positive\":{\"rating\":5,\"review\":\"I was very impressed with the color and pattern quality of this rug. It has just the right amount of color for a \\\"worn\\\" look and would work well with many colors as it's fairly neutral. The rug is lightweight and easy to get situated. It has a nice rubbery texture on the bottom so it doesn't slip or scratch my hardwood floors. If you're looking for a low-profile rug that is easy to vacuum over, this one is perfect. I've had it laid on in my guest bedroom, underneath the bed for about 2 months now... it still has creases from when it was packaged (folded). I may try to iron them out. Since this rug is thin, lightweight and flexible, it can easily be folded up and stored away which is nice. Most rugs can only roll up and are cumbersome to move/ store. Absolutely recommend this rug!\"}}",
